import { PendingButtons } from "./PendingButtons"
import { AddNotes } from "./AddNotes"

export const AcceptDenyContainer = ({ r, id }) => {

    if (r.isPending=true) {
        return <PendingButtons r={r} id={id} />
    } else if (r.isAccepted=true) {
        return <div className="staffNotesContainer">
        ✅ R has been accepted!<br></br><br></br>
            <AddNotes r={r} id={id}/>
        </div>
    } else if (r.isDenied=true) {
        return <div >❌ R has been denied.</div>
    }
}
